description:
Provides a base class for tests based on Microsoft.Extensions.DependencyInjection. Use common Startup.cs patterns like ConfigureServices(...) and Configure(...) to setup your tests.

Commonly used types:
ServiceTestsBase

Example:
[TestClass]
public class DatabaseCleanupBackgroundServiceTests : ServiceTestsBase
{
    protected override void ConfigureServices([NotNull] IServiceCollection services)
    {
        base.ConfigureServices(services);

        services.AddSingleton<DatabaseCleanupBackgroundService>();
        services.AddSingleton(sp => A.Fake<IDatabaseCleanupService>());
        services.AddSingleton<ILogRecorder, LogRecorderProvider>();
    }

    protected override void Configure([NotNull] IServiceProvider services, [NotNull] ILoggerFactory loggerFactory)
    {
        base.Configure(services, loggerFactory);
        loggerFactory.AddLogRecorder(services);
    }

    [TestMethod]
    public void CleanupSuggestedFailTest()
    {
        IDatabaseCleanupService databaseCleanupService = this.GetRequiredService<IDatabaseCleanupService>();
        A.CallTo(() => databaseCleanupService.RemoveObsoleteProjectsAsync(A<CancellationToken>.Ignored)).Throws(new InvalidOperationException(nameof(this.CleanupSuggestedFailTest)));

        DatabaseCleanupBackgroundService service = this.GetRequiredService<DatabaseCleanupBackgroundService>();
        service.CleanupSuggested();

        service.WaitAll();

        ILogRecorder logRecorder = this.GetRequiredService<ILogRecorder>();
        logRecorder.Messages.Single(m => m.LogLevel == LogLevel.Error).Exception.ShouldBeOfType<InvalidOperationException>().Message.ShouldBe(nameof(this.CleanupSuggestedFailTest));
    }
}

A library containing some helpers which greatly simplify the code needed for assertions and expected exceptions.

Examples:
Expect.Exception<ArgumentException>(async () => await someMethodAsync());
